import React from 'react'
import Planets from './Pages/Planet/Planets'
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css'
import UpperHeading from './Components/UpperHeading';

const App = () => {
  return (
    <div>
      <BrowserRouter>
      <UpperHeading/>
        <Routes>
          <Route path='/' element={<Planets/>}/>

        </Routes>
      </BrowserRouter>
    </div>
  )
}

export default App
